import React, { useState } from 'react'

function Signup() {
  const [name, setName] = useState();
  const [email,setEmail] = useState();
  const [password, setPassword] = useState()
  return (
    <div className='mt-[8rem] flex flex-col justify-center items-center gap-[1rem] max-w-[30rem] mx-auto'>
      <h2>Register</h2>
      <div className='w-full flex flex-col items-center gap-[1rem]'>
      <input type='text' placeholder='Enter Name' className='w-full py-[0.6rem] px-[1rem] border-solid border-2 border-black rounded'/>
      <input type='text' placeholder='Enter Email' className='w-full py-[0.6rem] px-[1rem] border-solid border-2 border-black rounded'/>
      <input type='password' placeholder='Enter Password' className='w-full py-[0.6rem] px-[1rem] border-solid border-2 border-black rounded'/>
      <button className='px-[1.5rem] py-[0.4rem] bg-blue-500 rounded mt-[1rem] text-white'>Signup</button>
      </div>
    </div>
  )
}

export default Signup;
